import React, { FunctionComponent, useState } from "react";
import Skin from "../../models/skin";

import "./style.css"
import voidskin from "../../models/void-skin";

type Props = {
    skin: Skin
};

const SkinDetail: FunctionComponent<Props> = ({ skin }) => {
    
    const [detailskin, setDetailskin] = useState(skin);

    return (
        <div className="testrouxdetail">
            <p>{detailskin.id}</p>
        </div>
    )
}

export default SkinDetail;
